        [Test, Order(1)]
        public void GetECheckList()
        {
            var response = _izibizClient.ECheck().ECheckList(Authentication.Token);
            Assert.NotNull(response);
            System.Diagnostics.Debug.WriteLine("E-Adisyon List : ");
            foreach (var req in response.contents)
            {
                System.Diagnostics.Debug.WriteLine("Adisyon uuid : " + req.uuid + "Adisyon ID : " + req.documentNo);
            }
            System.Diagnostics.Debug.WriteLine(response.pageable);
        }

